import React from "react";
import { Col, Row, Container, Nav } from "react-bootstrap";
import "./style.css";

function Cardie (props){
    return(

            <>
                <h4>{props.name}</h4>
                <p>{props.para}</p>
            </>
    )
}

const Footer = () => {
    return (
        <div style={{color: '#aaaaaa', background: "#111111" , position: "absolute", paddingTop: "50pt", paddingBottom: "50pt", left:"0" , right:"0"}}>
        <Container>
        <Row>
            <Col sm={2}>    
                <Cardie name="Navigation" para={
                    <div>
                    <Nav.Link>Home</Nav.Link>
                    <Nav.Link>About</Nav.Link>
                    <Nav.Link>Features</Nav.Link>
                    <Nav.Link>Portfolio</Nav.Link>
                    <Nav.Link>Our Team</Nav.Link>
                    </div>
                }
                />
            </Col> 
            <Col sm={2}>    
                <Cardie name="Products" para="On the other hand, we denounce with righteous indignation"/>
            </Col>      

            <Col sm={6}>    
                <Cardie className="text-center" name= "Social" para=""/>  
            </Col>
        </Row>
        </Container>
        </div>
     );
}

export default Footer;
